import React, { useState } from 'react';
import { Nav, Navbar } from 'react-bootstrap'

import {
  Route,
  NavLink,
  Links,
  HashRouter
} from "react-router-dom";
import Home from "./home.js";
import TextFiles from "./textfiles.js";

const EtIDNav = () => (
<>

<HashRouter>
<Navbar bg="dark" vSettingsSettingsariant="dark" sticky="top" >
<Navbar.Brand to="/home">
  <img
    alt=""
    src="/logo.svg"
    width="30"
    height="30"
    className="d-inline-block align-top"
  />{' '}
  Eth-ter-I-Die
  </Navbar.Brand>
  <Nav className="mr-auto" class="active">
  <NavLink to="/home">Home</NavLink>
  <NavLink to="/textfiles">The Files</NavLink>
  </Nav>
</Navbar>
</HashRouter>

</>

);


export default EtIDNav;
